import { configureStore, createSlice } from '@reduxjs/toolkit'

const initialState = {
    target: 0,
};

const targetSlice = createSlice({
    target: 'target',
    initialState,
    reducers: {
        changeTarget() {}
    }
})

const Store = configureStore({
    reducer: {
        target: targetSlice.reducer,
    },
})
export default Store
